function updateUserAddress {
  NONCE=$(erdpy account get --nonce --address="$MY_WALLET" --proxy="$PROXY")

  for transaction in "${UPDATE_TRANSACTIONS[@]}"; do
    set -- $transaction
    erdpy --verbose tx new --send \
          --outfile="genesis-fix-$NONCE.json" \
          --proxy=${PROXY} --chain="T" \
          --pem=$MY_WALLET_PEM \
          --nonce=$NONCE \
          --receiver=$DELEGATION_SC --data=$1 --gas-limit=500000000
    echo "Transaction sent with nonce $NONCE and backed up to genesis-fix-$NONCE.json."
    (( NONCE++ ))
  done
}
